                    </nav>
                </header>
                {/* <Route path="/" exact render={()=><h1>Home</h1>}/>
                <Route path="/" exact render={() => <h1>Home2</h1>} /> */}
                <Route path="/" exact component={Posts} />
                <Route path="/new-post" component={Posts} />
            </div>
        );
    }
}

export default Blog;
